    private static boolean lemonadeChange(int[] bills) {
        int[] changes = new int[2];
        changes[0] = 0;
        changes[1] = 0;
        for (int bill : bills) {
            int change = bill - 5;
            if(change>0) {
                if (change == 5) {
                    if(changes[0]<1)
                        return false;
                    else {
                        changes[0]--;
                        changes[1]++;
                    }
                }else {
                    if(changes[0]>0 && changes[1]>0){
                        changes[1]--;
                        changes[0]--;
                        continue;
                    }
                    if(changes[0]>2){
                        changes[0]-=3;
                        continue;
                    }
                    return false;
                }
            }else{
                changes[0]++;
            }
        }
        return true;
    }
